                <p className="subscribebox-title p1 text-white">Suscríbete para recibir actualizaciones sobre los sofás más recientes y relevantes.</p>
                <form className="subscribebox-form flex">
                    <input className="" type="text" placeholder="Ingresa tu email"/>
                        <button className="button button-secondary">Suscribirme</button>
                </form>
            </div>
        </article>
    );
};

export default NewsSection;
